import React from 'react';




const Card = ({ info } ) => {
    return(
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <div>
                <h2>{info.name}</h2>
                <p>{info.location}</p>
                <p>{info.rate}</p>
                <p>{info.comments}</p>
            </div>
        </div>
    );
}

export default Card;
